import React from 'react';
// import Button from './Button'

const Clock = (props) => {
    return (
        <div>
            <h3>Timer</h3>
            <h1>{props.days}:{props.hours}:{props.minutes}:{props.seconds}</h1>
        </div>
    )
}

export default Clock
